   return(
    <React.Fragment>
    <h2>Products</h2>
    <div className="container">
        <div className="row">
            {props.productArr.map(ele => {
                return (
                    <div className="col-3" key={ele.id}>
                        <Link to={`${props.match.url}/${ele.id}`}>
                            <Product
                                id={ele.id}
                                img={ele.img}
                                name={ele.name}
                                price={ele.price}
                            />
                            <br></br>
                        </Link>
                    </div>
                );
            })}
        </div>
    </div>
</React.Fragment>
   )
 }
export default Shoppingcart
